desc:
Activate 1 of these effects (but you can only use each effect of "Infernal Punisher" once per turn);
● Add 1 WATER Dinosaur monster from your Deck to your hand, then you can Special Summon it if your opponent controls a monster.
● Tribute 1 monster; Special Summon 1 Level 6 or higher FIRE monster from your hand, Deck, or GY, but negate its effects if it is a non-Fiend monster.

You can discard 1 card; add 2 "Megalith" monsters (1 Level 4 or lower and 1 Level 8 or higher) from your Deck to your hand. You can only use this effect of "Megalith Anastasis" once per turn. Once per turn, if you Ritual Summon a "Megalith" monster (except during the Damage Step): You can activate 1 of these effects (but you can only use each of these effects of "Megalith Anastasis" once per turn);
● Draw 2 cards, then discard 1 card.
● Tribute 1 monster your opponent controls.

If this card is destroyed by the effect of "Mystical Space Typhoon": You can Set this card. Activate 1 of these effects (but you can only use each of these effects of "Radiant Typhoon Chant" once per turn);
● Add 1 Level 4 or lower "Radiant Typhoon" monster from your Deck to your hand.
● Add 1 "Mystical Space Typhoon" from your Deck or GY to your hand.

If this card is destroyed by the effect of "Mystical Space Typhoon": You can Set this card. Activate 1 of these effects (but you can only use each of these effects of "Radiant Typhoon Manifestation" once per turn);
● Send 1 "Radiant Typhoon" monster from your Deck to the GY.
● Add 1 "Mystical Space Typhoon" from your Deck or GY to your hand.

If this card is destroyed by the effect of "Mystical Space Typhoon": You can Set this card. Activate 1 of these effects (but you can only use each of these effects of "Radiant Typhoon Vision" once per turn);
● Draw 2 cards, then if you have a "Radiant Typhoon" card or a Quick-Play Spell in your hand, discard 1 of them, or your entire hand if you don't.
● Add 1 "Mystical Space Typhoon" from your Deck or GY to your hand.

Activate 1 of these effects (but you can only use each effect of "Tri-Brigade Hammer" once per turn);
● Add 1 "Tri-Brigade" Spell/Trap from your Deck to your hand, except "Tri-Brigade Hammer".
● Banish any number of "Tri-Brigade" cards from your GY; Special Summon 1 "Tri-Brigade" Link Monster from your Extra Deck with Link Rating equal to the number banished, ignoring its Summoning conditions, also for the rest of this turn, you cannot Special Summon from the Extra Deck, except Beast, Beast-Warrior, or Winged Beast monsters.
